import styled from 'styled-components';

const ItemsStyles = styled.div`
  margin-top: calc(var(--navHeight) + var(--searchHeight));
  margin-bottom: 10rem;
  position: relative;

  .menu-container {
    background: lightblue;
  }
  .main-title {
    font-size: 3.5rem;
    text-transform: uppercase;
    font-weight: 400;
    color: darkblue;
    padding-top: 2rem;
    padding-left: 5rem;
  }
`;

export { ItemsStyles };
